def separate_paren_groups(paren_string: str) -> list[str]:
    def find_bracket_pairs(s: str) -> tuple[int, int]:
        stack = []
        pairs: dict[int, int] = {}
        for i, c in enumerate(s):
            if c == '(':
                stack.append(i)
            elif c == ')':
                j = stack.pop()
                pairs[j] = i
        return stack, pairs

    def groupify(paren_string: str) -> list[str]:
        stack, pairs = find_bracket_pairs(paren_string)
        groups = []
        while stack:
            j = stack.pop()
            k = pairs[j]
            groups.append(paren_string[j:k+1])
        return groups[::-1]

    paren_string = paren_string.replace(' ', '')
    if paren_string[0] != '(' or paren_string[-1] != ')':
        raise ValueError("Input string is not a valid set of parentheses.")
    groups = groupify(paren_string)
    return groups

