            end_idx = n - 1

    result = []
    i = k - 1
    while i >= 0 and end_idx >= start_idx:
        if unique_values[end_idx] == values[i]:
            result.append(unique_values[end_idx])
            i -= 1
            end_idx -= 1
        else:
            prev_end_idx = end_idx
            for j in range(end_idx, start_idx - 1, -1):
                if dp[j][i + 1] < dp[prev_end_idx][i]:
                    result.append(unique_values[j])
                    i -= 1
                    prev_end_idx = j

    return result

