def solve(s):
    result = ""
    change_case = False
    for i in s:
        if 'A' <= i <= 'Z':
            change_case = True
            result += chr(ord(i) + 32)
        elif 'a' <= i <= 'z':
            change_case = True
            result += chr(ord(i) - 32)
        else:
            result += i
    if not change_case:
        return s[::-1]
    return result

import hashlib

def string_to_md5(text):
    if not text:
        return None
    else:
        md5_hash = hashlib.md5()
        md5_hash.update(text.encode('utf-8'))
        return md5_hash.hexdigest()
